import React from "react";
import GoogleMapReact from "google-map-react";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";

function Map({ center, zoom, locations }) {
  // Define your marker component
  const Marker = ({ lat, lng }) => (
    <div style={{ color: "red", fontSize: "24px" }}>üìç</div>
  );

  return (
    <Container fluid>
      <Row>
        <Col md={6} className="mx-auto border rounded-lg">
          <div style={{ height: "50vh", width: "100%" }}>
            <GoogleMapReact center={center} zoom={zoom}>
              {locations.map(({ lat, lng }, index) => (
                <Marker key={index} lat={lat} lng={lng} />
              ))}
            </GoogleMapReact>
          </div>
        </Col>
      </Row>
    </Container>
  );
}

export default Map;
